import React, { useState } from 'react';
const products = [
  { id: 1, name: "T-Shirt", size: "M", color: "Red", price: 19.99, brand: "BrandA" },
  { id: 2, name: "Jeans", size: "32", color: "Blue", price: 49.99, brand: "BrandB" },
  { id: 20, name: "Sunglasses", size: "One Size", color: "Black", price: 49.99, brand: "BrandT" },
  { id: 3, name: "Jacket", size: "L", color: "Black", price: 79.99, brand: "BrandC" },
  { id: 4, name: "Sneakers", size: "10", color: "White", price: 59.99, brand: "BrandD" },
  { id: 5, name: "Hat", size: "One Size", color: "Green", price: 14.99, brand: "BrandE" },
  { id: 6, name: "Socks", size: "M", color: "Gray", price: 9.99, brand: "BrandF" },
  { id: 7, name: "Sweater", size: "S", color: "Yellow", price: 39.99, brand: "BrandG" },
  { id: 13, name: "Belt", size: "L", color: "Black", price: 14.99, brand: "BrandM" },
  { id: 14, name: "Scarf", size: "One Size", color: "Red", price: 12.99, brand: "BrandN" },
  { id: 15, name: "Gloves", size: "M", color: "Gray", price: 19.99, brand: "BrandO" },
  { id: 16, name: "Watch", size: "One Size", color: "Silver", price: 199.99, brand: "BrandP" },
  { id: 17, name: "Sandals", size: "8", color: "Brown", price: 29.99, brand: "BrandQ" },
  { id: 18, name: "Boots", size: "9", color: "Black", price: 89.99, brand: "BrandR" },
  { id: 8, name: "Shorts", size: "L", color: "Brown", price: 24.99, brand: "BrandH" },
  { id: 9, name: "Dress", size: "M", color: "Purple", price: 34.99, brand: "BrandI" },
  { id: 10, name: "Skirt", size: "S", color: "Pink", price: 29.99, brand: "BrandJ" },
  { id: 11, name: "Blouse", size: "M", color: "White", price: 22.99, brand: "BrandK" },
  { id: 12, name: "Coat", size: "XL", color: "Navy", price: 99.99, brand: "BrandL" },

  { id: 19, name: "Tie", size: "One Size", color: "Blue", price: 14.99, brand: "BrandS" },

];

function FilterBox() {
  const [items, setItems] = useState(products);

  const filterItems = () => {
    items.short();
  };

  return (
    <div style={styles.app}>
      <div style={styles.filter}>
        <button style={styles.button} onClick={filterItems}>Acending</button>
        <button style={styles.button} onClick={filterItems}>Decending</button>
      </div>
      <div style={styles.itemList}>
        <ul style={styles.ul}>
          {items.map((item, index) => (
           <li key={index} style={styles.li} >
            <h3>{item.id}</h3>
           <h3>{item.name}</h3>
           <p>{item.color}</p>
           <p>{item.brand}</p>
           <p><strong>{item.price}</strong></p>
         </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

const styles = {
  app: {
    display: 'flex',
    height: '100vh',
    margin: 0,
    fontFamily: 'Arial, sans-serif'
  },
  filter: {
    width: '20%',
    backgroundColor: '#f4f4f4',
    padding: '20px',
    boxShadow: '2px 0 5px rgba(0,0,0,0.1)'
  },
  itemList: {
    width: '80%',
    padding: '20px'
  },
  button: {
    padding: '10px 20px',
    backgroundColor: '#007BFF',
    color: '#fff',
    border: 'none',
    cursor: 'pointer',
    fontSize: '16px',
    borderRadius: '5px',
    margin:'5px'
  },
  ul: {
    listStyleType: 'none',
    padding: 0
  },
  li: {
    padding: '10px',
    borderBottom: '1px solid #ddd'
  }
};

export default FilterBox;
